  02> SEWELL, Benjamin Mark
  b 06.06.1993
  Benjamin b. at New Plymouth.
  02> SEWELL, Graham Bernard m on 12.04.1990 to FRASER, Ngaira Jayne
  b 14.10.1960
  b 11.04.1961
  Graham b. at New Plymouth and m. at St Paul's Presbyterian Church, Oamaru, Ngaira, d/o William
  James (Bill) Fraser and Patricia Wilma Schriffer, b. at Invercargill. Address: 278 Whiterocks
  Road, Weston, Oamaru.
  Graham attended Spotswood College, New Plymouth, and Victoria University (BA in History). He
  started as a filing clerk with the New Plymouth City Council then became Committee Administration
  Officer. In 1987 he was appointed Deputy Town Clerk for the Oamaru Borough Council and became
  Acting Town Clerk in 1989. Upon Local Government reorganisation in 1989 he was appointed Community
  Services Manager for the Waitaki District Council. He is presently completing the requirements to
  obtain a Master of Public Policy degree from Victoria University. A keen cornet player, Graham
  played for the New Plymouth City Band, the St Kilda Band, Dunedin, and the Oamaru Garrison. He has
  also played trumpet for various operatic productions. He is the original secretary of the Oamaru
  Whitestone Civic Trust and the Waitaki Development Board. His other interests include swimming,
  tennis and gardening.
  Ngaira was educated at the James Hargest High School, Invercargill, Waitaki Girls' High School,
  Oamaru (Head Girl, 1979), and Otago University (BCom in Marketing). She worked at various offices
  in Dunedin before taking up secondary teaching in 1987. In the early 1990s she taught at the
  Oamaru campus of the Otago Polytechnic. She is a keen craftsperson and a member of the Oamaru and
  Otago Patchworkers Guild. Other interests include gardening and hockey.
